import React, { useEffect } from "react";
import { KakaoMapAPIKey } from "./your-kakao-map-api-key"; // 자신의 Kakao 지도 API 키를 가져와야 합니다.

function Test() {
  useEffect(() => {
    const script = document.createElement("script");
    script.async = true;
    script.src = `https://dapi.kakao.com/v2/maps/sdk.js?appkey=${e6a331db57a19280eec798002d40195a}&autoload=false`;
    document.head.appendChild(script);

    script.onload = () => {
      kakao.maps.load(() => {
        const mapContainer = document.getElementById("map");
        const mapOption = {
          center: new kakao.maps.LatLng(33.450701, 126.570667),
          level: 3,
        };
        const map = new kakao.maps.Map(mapContainer, mapOption);
      });
    };
  }, []);

  return (
    <div>
      <div id="map" style={{ width: "500px", height: "400px" }}></div>
    </div>
  );
}

export default Test;
